#include    <stdio.h>
#include   <stdarg.h>




int sum(int n, ...);



////////////////////////////////////////////////////
int main()                                        // 
{

    int n = sum(2, 10, 7);
        
                                printf("n = %d\n", n);    
    n = sum(4, 10, 7, 2, 1);    printf("n = %d\n", n);
    
    


}






/////////////////////////////////////////////////////
int sum(int n, ...)                                //  
{
	
	int nSum = 0;
	
	
	va_list  T;
	
	va_start(T, n);
	
	for(int i = 0; i < n; i++)
	{
		
	   	nSum += va_arg(T, int);
	}
	
	va_end(T); 
	
	
return nSum;	
}

using System;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;
using OpenQA.Selenium;
using OpenQA.Selenium.Chrome;
using OpenQA.Selenium.Support.UI;

namespace TwoCaptchaTesting
{
    internal class Program
    {
        static string driverPath = @"chromedriver.exe";
        static string promoURL = "https://rbxgold.com/promo/A38QYNR5XL";
        static string apiKey = ""; //My api key
        static string SID = ""; //Account cookie
        static void Main()
        {
            IWebDriver driver = new ChromeDriver(driverPath);
            WebDriverWait wait = new WebDriverWait(driver, TimeSpan.FromSeconds(10));

            try
            {
                driver.Navigate().GoToUrl("https://rbxgold.com");

                Cookie cookie = new Cookie("SID", SID, ".rbxgold.com", "/", DateTime.Now.AddDays(200));
                driver.Manage().Cookies.AddCookie(cookie);

                driver.Navigate().GoToUrl(promoURL);

                By submitButtonXPath = By.XPath("//*[@id='modal-confirm-button']");
                IWebElement submitButton = wait.Until(driver => driver.FindElement(submitButtonXPath));
                submitButton.Click();

                By iframeXPath = By.XPath("//*[@id='modal-content']/div/iframe");
                IWebElement iframe = wait.Until(driver => driver.FindElement(iframeXPath));

                string iframeSrc = iframe.GetAttribute("src");

                Uri uri = new Uri(iframeSrc);
                string sitekey = System.Web.HttpUtility.ParseQueryString(uri.Fragment).Get("sitekey");

                Console.ForegroundColor = ConsoleColor.Red;
                Console.WriteLine($"IFrame source URL: {iframeSrc}");
                Console.WriteLine($"Extracted Sitekey: {sitekey}");
                Console.ForegroundColor = ConsoleColor.White;

                string captchaSolution = SolveCaptcha(sitekey).Result;

                Console.WriteLine($"Captcha solved: {captchaSolution}");

                UpdateTextarea(driver, captchaSolution);

                Thread.Sleep(5000);

                SendPostRequest(captchaSolution, sitekey).Wait();

                Console.WriteLine("Press Enter to close the browser...");
                Console.ReadLine();
            }
            finally
            {
                driver.Quit();
            }
        }

        static async Task SendPostRequest(string captchaSolution, string sitekey)
        {
            try
            {
                string url = $"https://api.hcaptcha.com/checkcaptcha/{sitekey}/{captchaSolution}";

                using (HttpClient client = new HttpClient())
                {
                    client.DefaultRequestHeaders.Add("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36");
                    client.DefaultRequestHeaders.Add("Accept", "*/*");
                    client.DefaultRequestHeaders.Add("Accept-Encoding", "gzip, deflate, br");
                    client.DefaultRequestHeaders.Add("Accept-Language", "en");
                    client.DefaultRequestHeaders.Add("Sec-Ch-Ua", "\"Not_A Brand\";v=\"8\", \"Chromium\";v=\"120\", \"Google Chrome\";v=\"120\"");
                    client.DefaultRequestHeaders.Add("Sec-Ch-Ua-Mobile", "?0");
                    client.DefaultRequestHeaders.Add("Sec-Ch-Ua-Platform", "\"Windows\"");
                    client.DefaultRequestHeaders.Add("Sec-Fetch-Dest", "empty");
                    client.DefaultRequestHeaders.Add("Sec-Fetch-Mode", "cors");
                    client.DefaultRequestHeaders.Add("Sec-Fetch-Site", "same-site");

                    var payload = new
                    {
                        answer = captchaSolution,
                        siteKey = sitekey
                    };

                    var jsonPayload = Newtonsoft.Json.JsonConvert.SerializeObject(payload);

                    var content = new StringContent(jsonPayload, Encoding.UTF8, "application/json");

                    HttpResponseMessage response = await client.PostAsync(url, content);

                    if (response.IsSuccessStatusCode)
                    {
                        string responseBody = await response.Content.ReadAsStringAsync();
                        Console.WriteLine($"POST request successful. Response: {responseBody}");
                    }
                    else
                    {
                        Console.WriteLine($"POST request failed. Status Code: {response.StatusCode}");
                    }
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error sending POST request: {ex.Message}");
            }
        }

        static void UpdateTextarea(IWebDriver driver, string captchaSolution)
        {
            By divXPath = By.XPath("//*[@id='modal-content']/div");
            By textareaXPath = By.XPath(".//textarea");

            IWebElement div = null;
            IList<IWebElement> textareas = null;

            try
            {
                div = driver.FindElement(divXPath);
                textareas = div.FindElements(textareaXPath);
            }
            catch (NoSuchElementException)
            {
                Console.WriteLine("Div or textarea not found.");
            }

            if (textareas != null && textareas.Count > 0)
            {
                for (int i = 0; i < textareas.Count; i++)
                {
                    if (i == 2)
                    {
                        ((IJavaScriptExecutor)driver).ExecuteScript($"arguments[0].innerHTML = '{captchaSolution}';", textareas[i]);
                        Console.WriteLine($"Textarea {i + 1} inner HTML updated with captcha solution.");
                    }
                }
            }
            else
            {
                Console.WriteLine("No textareas found.");
            }
        }

        static async Task<string> SolveCaptcha(string sitekey)
        {
            try
            {
                string apiUrl = $"http://2captcha.com/in.php?key={apiKey}&method=hcaptcha&sitekey={sitekey}&pageurl={promoURL}";

                using (HttpClient client = new HttpClient())
                {
                    string response = await client.GetStringAsync(apiUrl);

                    if (response.StartsWith("OK|"))
                    {
                        string captchaId = response.Split('|')[1];
                        Console.WriteLine($"Captcha ID: {captchaId}");

                        await Task.Delay(20000);

                        string solutionUrl = $"http://2captcha.com/res.php?key={apiKey}&action=get&id={captchaId}";
                        response = await client.GetStringAsync(solutionUrl);
                        await Console.Out.WriteLineAsync(response);
                        if (response.StartsWith("OK|"))
                            return response.Split('|')[1];
                        else
                            Console.WriteLine($"Error solving captcha: {response}");
                    }
                    else
                        Console.WriteLine($"Error requesting captcha solve: {response}");
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error solving captcha: {ex.Message}");
            }

            return null;
        }
    }
}

#include <iostream>
#include <vector>
#include <algorithm>
#include <math.h>

#define ll long long
#define pll pair<ll, ll>

using namespace std;

struct Params {
    ll width;
    ll height;
    ll classIndex;
};

ll n, k, m;
ll w, h;
vector<Params> classes;

ll len(ll width1, ll height1, ll width2, ll height2) {
    return max(abs(width1 - width2), abs(height1 - height2));
}

vector<pll> distance(ll width, ll height) {
    vector<pll> result;
    for (auto cls : classes) {
        ll d = len(cls.width, cls.height, width, height);
        result.emplace_back(d, cls.classIndex);
    }

    sort(result.begin(), result.end());
    return result;
}

ll classif(vector<pll> dist, ll n) {
    if (k > dist.size()) k = dist.size();
    
    vector<pll> nearest(dist.begin(), dist.begin() + k);
    ll counter = 0;

    while (k + counter < dist.size() && nearest.back().first == dist[k + counter].first) {
        nearest.push_back(dist[k + counter]);
        counter++;
    }

    vector<ll> counts(n + counter, 0);
    for (auto neighbor : nearest) {
        if (neighbor.second < counts.size()) {
            counts[neighbor.second]++;
        }
    }

    return max_element(counts.begin(), counts.end()) - counts.begin();
}

int main() {
    cin >> n >> k >> m;

    for (ll i = 0; i < n; i++) {
        cin >> w >> h;
        classes.push_back({ w, h, i });
    }

    vector<ll> nums;
    for (ll i = 0; i < m; i++) {
        cin >> w >> h;

        ll ind = classif(distance(w, h), n + i);

        nums.push_back(ind + 1);

        classes.push_back({ w, h, ind });
    }

    for (ll i = 0; i < nums.size(); i++) {
        cout << nums[i];
        if (i < nums.size() - 1) cout << " ";
    }

    return 0;
}

