{
    set<vector<int>> A = {{1}, {2}, {4}};                  // Пример множества A
    set<vector<int>> B = {{1, 1}, {1, 2}, {2, 1}, {2, 2}}; // Пример множества B

    vector<vector<int>> result = CartesianSL(A, B);
    cout << "Cartesian product of A and B: ";
    for (const vector<int> &pair : result)
