    x,y,l=0,0,0
    v=[(x,y)]
    for line in ll:
        d, n = (line.split()[0],int(line.split()[1])) if p1 else (line.split()[2][-2], int(line.split()[2][2:-2],16))
        x,y=x+dir[d][0]*int(n),y+dir[d][1]*int(n)
        v.append((x,y))
        l+=n
